// src/App.js

import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// Importações das páginas
import DoadorList from "./pages/doador/DoadorList";
import DoadorForm from "./pages/doador/DoadorForm";

import HospitalList from "./pages/hospital/HospitalList";
import HospitalForm from "./pages/hospital/HospitalForm";

import GerenteList from "./pages/gerente/GerenteList";
import GerenteForm from "./pages/gerente/GerenteForm";

import SolicitacaoList from "./pages/solicitacao/SolicitacaoList";
import SolicitacaoForm from "./pages/solicitacao/SolicitacaoForm";

import BolsaList from "./pages/bolsa/BolsaList";
import BolsaForm from "./pages/bolsa/BolsaForm";

import EstoqueList from "./pages/estoque/EstoqueList";
import EstoqueForm from "./pages/estoque/EstoqueForm";

// Novas funcionalidades
import DoacaoForm from "./pages/doacao/DoacaoForm";
import SolicitacaoEstoqueForm from "./pages/estoque/SolicitacaoEstoqueForm";

function App() {
  return (
    <Router>
      <div>
        <h1>Blood Bank</h1>

        <nav>
          <h2>Menu de Entidades</h2>

          {/* DOADOR */}
          <Link to="/doadores">Listar Doadores</Link> |{" "}
          <Link to="/doadores/novo">Novo Doador</Link>
          <br />

          {/* HOSPITAL */}
          <Link to="/hospitais">Listar Hospitais</Link> |{" "}
          <Link to="/hospitais/novo">Novo Hospital</Link>
          <br />

          {/* GERENTE */}
          <Link to="/gerentes">Listar Gerentes</Link> |{" "}
          <Link to="/gerentes/novo">Novo Gerente</Link>
          <br />

          {/* SOLICITAÇÃO */}
          <Link to="/solicitacoes">Listar Solicitações</Link> |{" "}
          <Link to="/solicitacoes/novo">Nova Solicitação</Link>
          <br />

          {/* BOLSA */}
          <Link to="/bolsas">Listar Bolsas</Link> |{" "}
          <Link to="/bolsas/novo">Nova Bolsa</Link>
          <br />

          {/* ESTOQUE */}
          <Link to="/estoque">Listar Estoque</Link> |{" "}
          <Link to="/estoque/novo">Adicionar ao Estoque</Link>
          <br />

          {/* DOAÇÃO E SOLICITAÇÃO */}
          <Link to="/doacoes">Registrar Doação</Link> |{" "}
          <Link to="/estoque/solicitar">Solicitar Bolsas</Link>
          <br />
        </nav>

        <hr />

        <Routes>
          {/* Doador */}
          <Route path="/doadores" element={<DoadorList />} />
          <Route path="/doadores/novo" element={<DoadorForm />} />

          {/* Hospital */}
          <Route path="/hospitais" element={<HospitalList />} />
          <Route path="/hospitais/novo" element={<HospitalForm />} />

          {/* Gerente */}
          <Route path="/gerentes" element={<GerenteList />} />
          <Route path="/gerentes/novo" element={<GerenteForm />} />

          {/* Solicitacao */}
          <Route path="/solicitacoes" element={<SolicitacaoList />} />
          <Route path="/solicitacoes/novo" element={<SolicitacaoForm />} />

          {/* Bolsa */}
          <Route path="/bolsas" element={<BolsaList />} />
          <Route path="/bolsas/novo" element={<BolsaForm />} />

          {/* Estoque */}
          <Route path="/estoque" element={<EstoqueList />} />
          <Route path="/estoque/novo" element={<EstoqueForm />} />

          {/* Novas funcionalidades */}
          <Route path="/doacoes" element={<DoacaoForm />} />
          <Route path="/estoque/solicitar" element={<SolicitacaoEstoqueForm />} />

          {/* Página inicial */}
          <Route path="/" element={<h2>Bem-vindo ao Banco de Sangue!</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
